import React from 'react';
import './Title_Text.css'
function Title_Text(){
    return(
        <div className="Title_Text">
            <div id="Unnatural">
                Unnatural
            </div>
            <div id="Language">
                Langauge
            </div>
            <br/>
            <div id="Processing">
                Processing
            </div>
        </div>
    )
}

export default Title_Text;
